import './App.css';
import NavbarButton from './components/NavbarButton';
import Presentation from './components/Presentation';
import AboutMe from './components/AboutMe';

function App() {
  return (
    <div className="App">
      <header>
        <div id='logo-container'>
          <button id='button-index' onClick={alert("inicio")}>Dekkvar</button>
        </div>
        <div id='navbarButton-container'>
          <NavbarButton onClick={alert}>About me</NavbarButton>
          <NavbarButton onClick={alert}>My projects</NavbarButton>
          <NavbarButton onClick={alert}>Contact me</NavbarButton>
        </div>
      </header>
      <div id='content-container'>
        <AboutMe />
      </div>
    </div>
  );
}




export default App;
